        return (
            <Carousel showArrows={true} onChange={onChange} onClickItem={onClickItem} onClickThumb={onClickThumb}>
                <div>
                    <img src="https://tastet.ca/wp-content/uploads/2018/08/cafe-banc-public-resto-montreal-17.jpg" alt="tsara" />
