                </div>
                <div>
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTLmHAP4gIbThWJsUgmtssCIZbcgcekUAOW1L52oYyVip-Gs60I3A" alt="tsara"  />
                    <p className="legend">Legend 2</p>
                </div>
                <div>
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT7kEepO_u_qrX7rUfTV-OO0YYPca_cT_DKJK1I5bML2Ipyr_FLIQ" alt="tsara"/>
                    <p className="legend">Legend 3</p>
                </div>
            </Carousel>
        );
    }
};

export default DemoCarousel
